import store from "./../../store";

let mixConsole;
export default class Console{
    constructor(){
        store.subscribe(this.handleChange)
    }

    static Create(){
        if(!mixConsole){
            mixConsole = new Console();
            return mixConsole;
        } else {
            return mixConsole;
        }
    }

    handleChange(){
        console.log(store);
    }

}
